import React from 'react';
import Timeline from './assets/Timeline.svg';


function timeline() {
  return (
    <div className="home">
      <header className="home-header">
        <img src={Timeline} className="home-circles" alt="circles"/> 
      </header>
      <button className="home-button">scroll</button>
    </div>
    );
}

export default timeline;
